            <Register/>
            </Route>
            <Route path="/login">
            <Login/>
            </Route>
            </Switch>



            </>
        }



        </>   
    )
}









const root = ReactDOM.createRoot(document.getElementById('app'))
root.render(
    <BrowserRouter>
    <App/>
    </BrowserRouter>
)
